import React from 'react';
import { Container, Navbar, Nav, Button } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

export default function LandingPage() {
  const navigate = useNavigate();

  return (
    <>
      <Navbar expand="lg" variant="dark" className="navbar" fixed="top">
        <Container>
          <Navbar.Brand href="/">LivingLink</Navbar.Brand>
          <Nav className="ms-auto">
            <Button variant="outline-light" onClick={() => navigate('/login')} className="me-2">Login</Button>
            <Button variant="light" onClick={() => navigate('/register')}>Register</Button>
          </Nav>
        </Container>
      </Navbar>

      <Container className="d-flex flex-column justify-content-center align-items-center" style={{ height: '90vh' }}>
        <h1 className="mb-4" style={{ color: 'var(--color-blue-2)' }}>Welcome to LivingLink</h1>
        <p className="mb-4 text-center" style={{ maxWidth: 600 }}>
          Manage your residential society easily with digital notices, payments, bookings, visitor management, maintenance requests, and full financial transparency.
        </p>
        <Button size="lg" variant="primary" onClick={() => navigate('/register')}>
          Get Started
        </Button>
      </Container>
    </>
  );
}
